アレッポからの贈り物(ノーマルタイプ) 190g<br>オリーブオイルを使用したオリーブ石鹸です。<br>汚れを落としながら、滑らかな潤いあるお肌へと整えます。 <br>使用方法<br>お湯で身体の汚れをざっと落とし、タオル等で泡立ててから全身を洗います。 <br>ご注意：・万一、お肌に合わない場合はご使用をやめて下さい。・湿気の多い場所に保管されますと、石鹸が柔らかくなりますので、ソープディッシュ等で、水気を切り、風通しの良い場所に保管頂けますと、長持致します。・本商品は食べられません。誤って口に入れないよう、幼児の手の届かないところに保管下さい。・手作り石鹸のため、色・形状・重量に多少のバラツキがございます。 成分石鹸素地(オリーブオイル) <br>原産国：シリア<br><br>無添加石鹸とは無添加石鹸とは、化学合成添加物を使わない石鹸のことです。<br>無添加石鹸だからこその洗い上がり、素材の香りをお楽しみいただけます。 <br><br>ブランド：アレッポの石鹸<br>JAN：4517307003253<br><br>区分：化粧品<br><br>発売元、製造元、輸入元又は販売元：丸長<br><br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<style>
